AAAAAAAAAAAAAAAMIE7AAAAAAAAAAAAAAAAAAAAAAAAAAAAAMAE7gAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAE7gDAAAAAAAAAAAAAAAAAAAAAAAAAAAAAEzgDgAAAAAAAAAAAAAAAAAAAAAAAAAAAAAwgTsAAAAAAAAAAAAAAAAAAAAAAAAAAAAAwATuAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAATuAMAAAAAAAAAAAAAAAAAAAAAAAAAAAAATOAOAAAAAAAAAAAAAAAAAAAAAAAAAAAAALAAAAD//+zcsQAAAADAIH/rPcMokATuAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAATuAMAAAAAAAAAAAAAAAAAAAAAAAAAAAAATOAOAAAAAAAAAAAAAAAAAAAAAAAAAAAAADCBOwAAAAAAAAAAAAAAAAAAAAAAAAAAAADABO4AAAAAAAAAAAAAAAAAAAAAAAAAAAAAABO4AwAAAAAAAAAAAAAAAAAAAAAAAAAAAABM4A4AAAAAAAAAAAAAAAAAAAAAAAAAAAAAMIE7AAAAAAAAAAAAAAAAAAAAAAAAAAAAAMAE7gAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAE7gDAAAAAAAAAAAAAAAAAAAAAAAAAAAAAEzgDgAAAAAAAAAAAAAAAAAAAAAAAAAAAACwAAAA///t3LEAAAAAwCB/6z3DKJAE7gAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAE7gDAAAAAAAAAAAAAAAAAAAAAAAAAAAAAEzgDgAAAAAAAAAAAAAAAAAAAAAAAAAAAAAwgTsAAAAAAAAAAAAAAAAAAAAAAAAAAAAAwATuAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAATuAMAAAAAAAAAAAAAAAAAAAAAAAAAAAAATOAOAAAAAAAAAAAAAAAAAAAAAAAAAAAAADCBOwAAAAAAAAAAAAAAAAAAAAAAAAAAAADABO4AAAAAAAAAAAAAAAAAAAAAAAAAAAAAABO4AwAAAAAAAAAAAAAAAAAAAAAAAAAAAABM4A4AAAAAAAAAAAAAAAAAAAAAAAAAAAAAsABNk8YqZtmEJgAAAABJRU5ErkJggg==\",\"mime\":\"image/png\",\"copyright\":{\"license\":\"U\"},\"width\":6000,\"height\":3375}},\"name\":\"Hot Mess Express\",\"description\":\"It looks like you&#039;re struggling with productivity. Don&#039;t worry; everyone has room for improvement. Try to identify your main obstacles and work on strategies to overcome them.\"}],\"questions\":[{\"image\":{},\"answers\":[{\"image\":{},\"text\":\"Rarely, I&#039;m always on top of my tasks.\",\"personality\":\"Productivity Master\"},{\"image\":{},\"text\":\"Sometimes, but I can usually get back on track.\",\"personality\":\"Productivity Learner\"},{\"image\":{},\"text\":\"Often, I tend to put things off until the last minute.\",\"personality\":\"Hot Mess Express\"}],\"text\":\"How often do you find yourself procrastinating?\"},{\"image\":{},\"answers\":[{\"image\":{},\"text\":\"I always meet them, usually with time to spare.\",\"personality\":\"Productivity Master\"},{\"image\":{},\"text\":\"I meet them most of the time, but it&#039;s often a rush.\",\"personality\":\"Productivity Learner\"},{\"image\":{},\"text\":\"I struggle and sometimes miss them.\",\"personality\":\"Hot Mess Express\"}],\"text\":\"How do you handle deadlines?\"},{\"image\":{},\"answers\":[{\"image\":{},\"text\":\"I can juggle multiple tasks without losing focus.\",\"personality\":\"Productivity Master\"},{\"image\":{},\"text\":\"I can handle a few tasks, but it gets tricky.\",\"personality\":\"Productivity Learner\"},{\"image\":{},\"text\":\"Multitasking usually makes me feel overwhelmed.\",\"personality\":\"Hot Mess Express\"}],\"text\":\"How good are you at multitasking?\"},{\"image\":{},\"answers\":[{\"image\":{},\"text\":\"Yes, I always have a clear plan for my day.\",\"personality\":\"Productivity Master\"},{\"image\":{},\"text\":\"Sometimes, but I don&#039;t always stick to it.\",\"personality\":\"Productivity Learner\"},{\"image\":{},\"text\":\"No, I usually go with the flow.\",\"personality\":\"Hot Mess Express\"}],\"text\":\"Do you create a daily plan?\"},{\"image\":{},\"answers\":[{\"image\":{},\"text\":\"It&#039;s quiet and conducive to focus.\",\"personality\":\"Productivity Master\"},{\"image\":{},\"text\":\"It&#039;s sometimes noisy, but I manage.\",\"personality\":\"Productivity Learner\"},{\"image\":{},\"text\":\"It&#039;s usually noisy and distracting.\",\"personality\":\"Hot Mess Express\"}],\"text\":\"How noisy is your study/work environment?\"},{\"image\":{},\"answers\":[{\"image\":{},\"text\":\"Rarely, I keep my phone on silent or away.\",\"personality\":\"Productivity Master\"},{\"image\":{},\"text\":\"Sometimes, but I can usually ignore them.\",\"personality\":\"Productivity Learner\"},{\"image\":{},\"text\":\"Often, I find myself checking my phone frequently.\",\"personality\":\"Hot Mess Express\"}],\"text\":\"How often do phone notifications interrupt your work?\"},{\"image\":{},\"answers\":[{\"image\":{},\"text\":\"I take regular, scheduled breaks to recharge.\",\"personality\":\"Productivity Master\"},{\"image\":{},\"text\":\"I take breaks when I remember or feel tired.\",\"personality\":\"Productivity Learner\"},{\"image\":{},\"text\":\"I either forget to take breaks or take too many.\",\"personality\":\"Hot Mess Express\"}],\"text\":\"How regularly do you take breaks?\"},{\"image\":{},\"answers\":[{\"image\":{},\"text\":\"It&#039;s always tidy and organized.\",\"personality\":\"Productivity Master\"},{\"image\":{},\"text\":\"It&#039;s somewhat cluttered, but I can find what I need.\",\"personality\":\"Productivity Learner\"},{\"image\":{},\"text\":\"It&#039;s usually messy and hard to navigate.\",\"personality\":\"Hot Mess Express\"}],\"text\":\"How cluttered is your desk or workspace?\"},{\"image\":{},\"answers\":[{\"image\":{},\"text\":\"Rarely, they know not to disturb me.\",\"personality\":\"Productivity Master\"},{\"image\":{},\"text\":\"Occasionally, but it&#039;s usually not a big deal.\",\"personality\":\"Productivity Learner\"},{\"image\":{},\"text\":\"Frequently, it disrupts my workflow.\",\"personality\":\"Hot Mess Express\"}],\"text\":\"How often do friends and family interrupt you while working?\"},{\"image\":{},\"answers\":[{\"image\":{},\"text\":\"I&#039;m very productive and achieve my goals.\",\"personality\":\"Productivity Master\"},{\"image\":{},\"text\":\"I&#039;m productive, but there&#039;s room for improvement.\",\"personality\":\"Productivity Learner\"},{\"image\":{},\"text\":\"I struggle with productivity and often feel behind.\",\"personality\":\"Hot Mess Express\"}],\"text\":\"How do you feel about your overall productivity?\"}],\"startText\":\"Start\",\"progressText\":\"@total\",\"retakeText\":\"Retake the quiz\",\"animation\":true,\"buttonColor\":\"405de9\",\"progressbarColor\":\"89ceff\"}","library":"H5P.PersonalityQuiz 1.0","contentUrl":".","metadata":{"license":"U","title":"How_Productive_Are_You","defaultLanguage":"en"
